#import libraries
import pandas as pd
import numpy as np
import statsmodels.api as sm
from statsmodels.tsa.api import VAR

# Example data (replace with your own data)
#Step 3: Prepare your time series data

#Load your time series data into a Pandas DataFrame. Ensure that your data is in the right format with a timestamp index.
data = pd.read_excel('/content/cleaned_dataset.xlsx', parse_dates=True)

data

data.shape

data = data.drop_duplicates(subset="Year")

data

data.columns

data.columns

column_random_regressor=['Year','Number of ATMs per 100,000 adults'
,
'Number of depositors with commercial banks per 1,000 adults',
'Number of borrowers from commercial banks per 1,000 adults',
'Value of mobile money transactions (during the reference year) (% of GDP)']
new_subset=data[column_random_regressor]
new_df=pd.DataFrame(new_subset)
new_df.columns

new_df

#Modelling
X = new_df.drop(columns=['Value of mobile money transactions (during the reference year) (% of GDP)'])
y = new_df['Value of mobile money transactions (during the reference year) (% of GDP)']
print(X.shape)
print(y.shape)

K = 5
split = 0.80

from sklearn.ensemble import RandomForestRegressor
from sklearn.model_selection import train_test_split
from sklearn.metrics import mean_absolute_error
from sklearn.preprocessing import StandardScaler

accuracy = []

for fold in range(0, K):

  # Instantiate algorithm
  model = RandomForestRegressor()
  scaler = StandardScaler()

  # Create training and test samples
  X_train, X_test, y_train, y_test = train_test_split(X, y, train_size=split, random_state=42)

  # Scale X data, we scale the data because it helps the algorithm to converge
  # and helps the algorithm to not be greedy with large values
  scaler.fit(X_train)
  X_train = scaler.transform(X_train)
  X_test = scaler.transform(X_test)

  # Train model
  trained_model = model.fit(X_train, y_train)

  # Generate predictions on test sample
  y_pred = trained_model.predict(X_test)

  # Compute accuracy, using mean absolute error
  mae = mean_absolute_error(y_true=y_test, y_pred=y_pred)
  accuracy.append(mae)
  print(f"Fold {fold + 1}: MAE = {mae:.3f}")

print(f"Average MAE: {(sum(accuracy) / len(accuracy)):.2f}")

#We can see that the mean absolute error (MAE) is almost exactly the same each time. This is a good sign, it shows that the performance of the model is consistent across different random samples of the data, which is what we want. In other words, it shows a robust nature.



